function ExpenseDate(props) {
    const year = props.date.getFullYear();
    const month = props.date.toLocaleString("en-UK", { month: "long" });
    const day = props.date.toLocaleString("en-UK", { day: "2-digit" });

    return (
        <div>
            <div>{month}</div>
            <div>{year}</div>
            <div>{day}</div>
        </div>
    );
}

export default ExpenseDate;
